const SocialCard=styled.section`
margin:0;
position:relative;
top:12%;

 `;

function Social() {
    return(
        <>
        <Navbar/>

        <SocialCard>
            <h1> non sacciu farlo</h1>
        </SocialCard>

        <Footer/>
        </>
    )
}
export default Social;
